import React, { useState } from 'react';
import axios from 'axios';

function App() {
  const [graphFile, setGraphFile] = useState(null);
  const [countFile, setCountFile] = useState(null);
  const [graphUrl, setGraphUrl] = useState(null);
  const [rowCount, setRowCount] = useState(null);
  const [columnCount, setColumnCount] = useState(null);

  const handleGraphFileUpload = (event) => {
    setGraphFile(event.target.files[0]);
  };

  const handleCountFileUpload = (event) => {
    setCountFile(event.target.files[0]);
  };

  const handleGraphUpload = () => {
    const formData = new FormData();
    formData.append('file', graphFile);

    axios.post('/upload/graph', formData)
      .then((response) => {
        console.log(response.data);
        if (response.data.success) {
          setGraphUrl(response.data.graph_url);
        }
      })
      .catch((error) => {
        console.error(error);
        // Handle error if necessary
      });
  };

  const handleCountUpload = () => {
    const formData = new FormData();
    formData.append('file', countFile);

    axios.post('/upload/count', formData)
      .then((response) => {
        console.log(response.data);
        if (response.data.success) {
          setRowCount(response.data.rows);
          setColumnCount(response.data.columns);
        }
      })
      .catch((error) => {
        console.error(error);
        // Handle error if necessary
      });
  };

  return (
    <div>
      <div>
        <h2>Upload CSV for Graph</h2>
        <input type="file" onChange={handleGraphFileUpload} />
        <button onClick={handleGraphUpload}>Upload</button>

        {graphUrl && <img src={graphUrl} alt="Graph" />}
      </div>

      <div>
        <h2>Upload CSV for Row and Column Count</h2>
        <input type="file" onChange={handleCountFileUpload} />
        <button onClick={handleCountUpload}>Upload</button>

        {rowCount !== null && columnCount !== null && (
          <div>
            <p>Rows: {rowCount}</p>
            <p>Columns: {columnCount}</p>
          </div>
        )}
      </div>
    </div>
  );
}

export default App;
